import React from 'react';

import {NavLink, Link} from 'react-router-dom';

const Nav = () => {
    return (
        <>
            <div id="navBar">
                <div className="man">
                    <ul>
                        <li> <a href="/">Home</a> </li>
                        <li> <a href="/services">Services</a> </li>
                        <li> <a href="/about">About</a> </li>
                        <li> <a href="/contact">Contact</a> </li>
                    </ul>
                    </div>
                </div>
        </>
    )
}

export default Nav;
